export const LOGIN_USER = "LOGIN_USER";

export const LOGIN_USER_SUCCESS = "LOGIN_USER_SUCCESS";

export const LOGIN_USER_ERROR = "LOGIN_USER_ERROR";

export const LOGIN_USER_ERROR_FIELD = "LOGIN_USER_ERROR_FIELD";

export const LOGOUT_USER = "LOGOUT_USER";

export const CLEAR_USER_INFORMATION = "CLEAR_USER_INFORMATION";



export const LoginAction = (dataInsc) => ({
  "type": LOGIN_USER,
  "data": dataInsc
});

export const loginUserSuccess = (token) => ({
    "type": LOGIN_USER_SUCCESS,
    token
});

export const loginError = (error) => ({
    "type": LOGIN_USER_ERROR,
    error
});

export const loginErrorField = (errorField) => ({
    "type": LOGIN_USER_ERROR_FIELD,
    errorField
});

export const logoutAction = () => ({
  "type": LOGOUT_USER
});

export const ClearUserInformation = () => ({
  type: "CLEAR_USER_INFORMATION",
});
